//create
//テーブルrowを設定
void populateDb(Database database, int version) async{
  //id:プライマリキー name:山名 lat:経度 lon:緯度 elevation:標高 grp:県ナンバ:お気に入り有無
  await database.execute("CREATE TABLE MyData(id INTEGER PRIMARY KEY, name TEXT, lat DOUBLE, lon DOUBLE, elevation DOUBLE, grp INTEGER, favorite INTEGER default 0)");
}

//update idから値を更新
  updateDb(String id) async{
      //databaseへ接続
      String databasesPath = await getDatabasesPath();
      String dbPath = join(databasesPath, 'my.db');
      var database = await openDatabase(dbPath, version: 1, onCreate: populateDb);
       //指定テーブルから選択した山データのsel値を更新　0->1
      await database.rawQuery('UPDATE MyData SET sel=1 WHERE id=$id');
      print("UPDATE compleate!");
  }

  